import React, { Component } from 'react';
import User from './User.js';
import Guest from './Guest.js';

export default class App extends Component {
    state = {
        name:"Lathesh",
        value:100
    }
    render() {
        return (
            <div>
                {this.state.name}
                <User name={this.state.name}/>
                <Guest name={this.state.value}/>
            </div>
        )
    }
}
